import React, { Component } from 'react';
import './NavLeft.css';
import { Jumbotron, Nav } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
//Nav, NavItem, Jumbotron, Grid, Row, Col, Image, Button

export default class NavLeft extends Component {
    render() {
        return (
            <div className="container-nav-left">

                <Nav default collapseOnSelect className="nav-left">
                <h1 className="title-nav-left">Anastasia</h1>
                    <NavLink to="/signup" className="button-align"><button className="signup-home">SIGN UP</button></NavLink>
                    <NavLink to="/signin" className="button-align"><button className="signin-home">SIGN IN</button></NavLink>
                </Nav>


            </div>


    );
}
}
